    "Organochlorine compounds and mercury in bald eagle eggs, Penobscot River, Maine",nt"tracking_summary":
    {ntt"total": 16,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:48:54.529797",nt"name": "organochlorine-compounds-and-mercury-in-bald-eagle-eggs-penobscot-river-maine",nt"isopen":
    false,nt"url": null,nt"notes": "Four bald eagle (Haliaeetus leucocephalus)
    eggs from three nests on the Penobscot River, Maine, were analyzed for organochlorine
    contaminants and mercury. Eggs were collected in June 2000 within two weeks of nest
    abandonment. Tetrachlorodibenzo-p-dioxin toxic equivalents (TEQs) based on World
    Health Organization toxic equivalency factors for birds were determined for each
    egg. TEQs determined solely from polychlorinated dibenzodioxins and dibenzofurans
    (TEQ PCDD/Fs) in the four eggs ranged from 15 to 59 pg/g, fresh wet weight (mean
    35 pg/g, fww), while Total TEQs (PCDD/Fs + planar PCBs) ranged from 223 to 570 pg/g,
    fww (mean 385 pg/g, fww). The percent of total TEQs derived from PCDD/Fs averaged
    approximately 8%. PCB# 126 was the greatest contributor to the Total TEQ. The mean
    concentrations of total PCBs and p,pu2019-DDE in eggs were 9.05 migrogram/g, fww,
    and 1.53  microgram/g, fww, respectively. Compared to previous Maine eagle egg studies,
    DDE levels were not markedly elevated in these 4 eggs. TEQ and total PCB levels
    in Maine eggs, however, continue to exceed No Effect Levels suggested for bald eagles.
    Mercury concentrations in eggs ranged from 0.12  microgram/g to 0.25  microgram/g,
    fww (mean 0.17  microgram/g, fww). Mercury in these 4 eggs occurred at lower concentrations
    than previous Maine eagle egg studies and below suggested effects thresholds.",nt"license_title":
